import React, { Component } from 'react'
import {
  StyleSheet,
  TouchableOpacity,
  Text,
  View,
} from 'react-native'


class App extends Component {
  state = {
    move: "O",
    board: new Array(9)
  }

  onPress = (pos) => {
    console.log(pos);
    alert(this.state.board);
  }

 render() {
    return (
      <View style={styles.container}>
        <View style={styles.title}>
          <Text style={styles.title_text}>TicTacToe</Text>
        </View>
        <View style={styles.game_board}>
        <TouchableOpacity style={styles.box} onPress={() => this.onPress(0)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(1)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(2)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(3)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(4)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(5)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(6)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(7)}>
        </TouchableOpacity>

        <TouchableOpacity style={styles.box} onPress={() => this.onPress(8)}>
        </TouchableOpacity>

      </View>

      </View>

    )
  }
}

const styles = StyleSheet.create({
  container:
  {
    justifyContent: 'center',
    alignItems: 'center',
  },

  title:
  {
    marginTop: 10,
    paddingTop: 50,
    height: 100,
  },

  title_text:
  {
    fontSize: 50,
    fontWeight: "700"
  },

  game_board: {
    flexWrap: "wrap",
    flexDirection: "row",
    backgroundColor: "aliceblue",
    maxHeight: 360,
    marginTop: 100,
    maxWidth: 360,
    alignContent: 'center',
    borderRadius: 10,

  },
  box: {
    width: 120,
    height: 120,
    backgroundColor: "deepskyblue",
    borderRadius: 10,
    borderWidth: 1,
    borderColor: 'white'
  },
})

export default App;
